import React from 'react';
import styled from 'styled-components';

function Login() {
  return (
    <Container>
    <Logo>
        <img src="logonew.png" alt="" />
    </Logo>
    <FormContainer>
        <h3>Sign-In</h3>
    </FormContainer>
    </Container>
  )
}
const Container = styled.div`
    width : 100%;
    min-width:450px;
    height: fit-content;
    padding:15px;
    margin:auto;
    display:flex;
    flex-direction:column;
    align-items:center;
    border:1px solid red;
`;

const Logo = styled.div`
    width:120px;
    img{
        width:100%;
    }
`;

const FormContainer =styled.form`
    border:1px solid lightgray;
    width:55%;
    height:400px;
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    padding:15px;

    h3{
        font-size:28px;
        font-weight:400;
        line-height:33px;
        align-self:flex-start;
    }

`;

export default Login
